Ofishol Stetus.
Dem Cook Ailen Māori b' kam a ofishol laenghwij o' dem Cook Ailen i' 2003, but haufs no ofishol stetus i' Nyuu Ziilan, despiit t' fakt tat Nyuu Ziilan es signatorii t' t' Yunitid Nayshuns Declarayshun a' t' Riits o' Indijenus Piopels.
Te Reo Maori Akt definishun.
T' &lt;a href="http%3A//www.paclii.org/ck/legis/num_act/trma2003130/"&gt;Te Reo Maori Act&lt;/a&gt; staits tat Māori:
(sii ekstirnal links).
Pukapukan es konsidired b' skolars an' talas tuu t' b' a distinkt laenghwij moor rilii riilated t' Sāmoan and Tokelauan t' Dem Cook Ailen Māori. Et b'longs t' t' Samoic subgroup o' t' Polynesian laenghwij family. T' intenshun b'hiind encludin' Pukapukan i' t' definishun o' Te Reo Maori wos t' meik shur o' ets protecshun.
T' dialekts o' t' Iist Polynesian warietiis o' Dem Cook Ailen (colectivlii refirred t' as Dem Cook Ailen Māori) es:
Dem Cook Ailen Māori es rilii relatid t' &lt;a href="Tahityan"&gt;Tahitian&lt;/a&gt; an &lt;a href="Nyuu%20Ziilan"&gt;Nyuu Z&lt;/a&gt;iilan &lt;a href="Maori"&gt;Māori&lt;/a&gt;, an deir es a degrii o' mushual intelijibilitii wit' both o' dese laenghwijs.
T' laenghwij es teoreticalii regulatid b' t' "Kopapa Reo" meik'd i' 2003, but dis organisayshun es currentlii dorment.
Writin sistem an pronunsiayshun.
Deir esa debait o' t' stendardisayshun o' t' writin sistem. Altho t' usaj o' t' macron (־) "te makarona" an t' glottel stawp "amata" (ꞌ) (/ʔ/) es recommendid, most talas don't use t' tuu diakritiks i' dail writin'. Dem &lt;a href="http%3A//bibles.org/rar-CIMRNT/Matt/1"&gt;Cook Ailen Māori Revis'd Nyuu Testament&lt;/a&gt; uses a stendardis'd ortografii (spellin sistem) tat encludes t' diakritiks wen dey're fonemic but nor elsabout.
Gramma.
Dem Cook Ailen Māori es an isolatin laenghwij wit' a rilii smaal morfolojii. Kaas es mark'd b' t' partikul tat inishiaits a nown frase, an lik most o' dem Iist Polynesian laenghwijs, dem Cook Ailen Māori haufs nominativ-accusativ kas markin.
T' unmark'd konstituent orduh es predicait inishul. Tat es, werb inishul i' werbal frases an nominal-predicaot inishul i' non-werbal frases.

Tokelau esa dapendint teritrii o' Nyuu Ziilan i' t' sowthern Pesifik Oshen. Et konsist a' trii tropikal koral atols (Atafu, Nukunonu an Fakaofo), wit' a kombin'd lan airea a' 10 km2 (4 sq mi). T' kapitel rotaits yialii b'twiin dem trii atols. Tokelau lys north o' dem Samoan Ailen, iist o' Tuwaluu, sowth o' dem Phoenix Ailen, sowthwest o' dem mor distent Line Ailen, an northwest o' dem Cook Ailen. Swains Ailen es jiiografikalii par o' Tokelau, but es subjekt t' a kurrent teritrorial dispuut an es kurentlii amminister'd b' dem &lt;a href="Yunitid%20Staits%20o%27%20Merika"&gt;Yunitid Staits&lt;/a&gt; as par o' &lt;a href="Merikan%20Samoa"&gt;Merikan Samoa.&lt;/a&gt;
Tokelau haufs a popyulayshun a' aproksimatelii 1503 piopel, t' forth-smaales popyulayshun a' eni sowyern stait o dependsii. As a' t' 2019 census, abaut 48%o' dem piopel i' Tokelau wer born i' an otha kuntrii, mostlii i' Samoa an Nyuu Ziilan. T' kuntrii haufs a lif ekspansatii a' 69, komparable wit' otha Oceanian ailen kuntriis. Aproksimatelii 94% a' t' popyulayshun tal Tokelauan as a fas laenghwij. T' kuntrii haufs t' smaales ekonomii i' t' werl, alla ets a liida i' renyuuable enerjii, b'in t' fas 100% sola power'd nayshun i' t' werld.
T' motto a' Tokelau es "Tokelau mo te Atua", wich miins "Tokelau f' t' Almitii."

